import React, { useState, useEffect } from 'react';
import {
  AppBar,
  Box,
  Drawer,
  IconButton,
  Toolbar,
  Typography,
  TextField,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Snackbar,
  Alert,
  CircularProgress,
} from '@mui/material';
import { DataGrid } from '@mui/x-data-grid';
import MenuIcon from '@mui/icons-material/Menu';
import SaveIcon from '@mui/icons-material/Save';
import axios from 'axios';

const drawerWidth = 240;

function Dashboard() {
  const [models, setModels] = useState([]);
  const [open, setOpen] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [selectedRows, setSelectedRows] = useState([]);
  const [newModel, setNewModel] = useState({
    name: '',
    gladia: '',
    fastwhisper: '',
    yandexSpeechKit: '',
  });

  const columns = [
    { field: 'id', headerName: 'ID', width: 70 },
    { 
      field: 'name', 
      headerName: 'Name', 
      width: 200,
      editable: true,
    },
    { 
      field: 'gladia', 
      headerName: 'Gladia', 
      width: 200,
      editable: true,
    },
    { 
      field: 'fastwhisper', 
      headerName: 'FastWhisper', 
      width: 200,
      editable: true,
    },
    { 
      field: 'yandexSpeechKit', 
      headerName: 'Yandex Speech Kit', 
      width: 200,
      editable: true,
    },
  ];

  useEffect(() => {
    fetchModels();
  }, []);

  const fetchModels = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await axios.get('http://localhost:8085/api/models');
      setModels(response.data);
    } catch (error) {
      console.error('Error fetching models:', error);
      setError('Failed to fetch models. Please try again later.');
    } finally {
      setLoading(false);
    }
  };

  const handleCreateModel = async () => {
    setLoading(true);
    setError(null);
    try {
      await axios.post('http://localhost:8085/api/models', newModel);
      setOpen(false);
      fetchModels();
      setNewModel({
        name: '',
        gladia: '',
        fastwhisper: '',
        yandexSpeechKit: '',
      });
    } catch (error) {
      console.error('Error creating model:', error);
      setError('Failed to create model. Please try again later.');
    } finally {
      setLoading(false);
    }
  };

  const handleUpdateAll = async () => {
    if (selectedRows.length === 0) {
      setError('Please select at least one model to update');
      return;
    }

    setLoading(true);
    setError(null);
    try {
      const updatedModels = selectedRows.map(rowId => {
        const model = models.find(m => m.id === rowId);
        return {
          ...model,
          id: rowId
        };
      });

      await axios.put('http://localhost:8085/api/models/update-all', updatedModels);
      await fetchModels();
      setError(null);
    } catch (error) {
      console.error('Error updating models:', error);
      setError('Failed to update models. Please try again later.');
    } finally {
      setLoading(false);
    }
  };

  const handleRowEditCommit = (params) => {
    const updatedModels = models.map(model => {
      if (model.id === params.id) {
        return {
          ...model,
          [params.field]: params.value
        };
      }
      return model;
    });
    setModels(updatedModels);
  };

  const filteredModels = models.filter(model =>
    model.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <Box sx={{ display: 'flex' }}>
      <AppBar position="fixed" sx={{ zIndex: (theme) => theme.zIndex.drawer + 1 }}>
        <Toolbar>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" noWrap component="div">
            Speech Models Dashboard
          </Typography>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
          },
        }}
      >
        <Toolbar />
        <Box sx={{ overflow: 'auto', p: 2 }}>
          <TextField
            fullWidth
            label="Search by name"
            variant="outlined"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            sx={{ mb: 2 }}
          />
          <Button
            variant="contained"
            fullWidth
            onClick={() => setOpen(true)}
            disabled={loading}
            sx={{ mb: 2 }}
          >
            Add New Model
          </Button>
          <Button
            variant="contained"
            fullWidth
            onClick={handleUpdateAll}
            disabled={loading || selectedRows.length === 0}
            startIcon={<SaveIcon />}
          >
            Save Changes
          </Button>
        </Box>
      </Drawer>
      <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
        <Toolbar />
        <div style={{ height: 600, width: '100%', position: 'relative' }}>
          {loading && (
            <Box
              sx={{
                position: 'absolute',
                top: 0,
                left: 0,
                right: 0,
                bottom: 0,
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                backgroundColor: 'rgba(255, 255, 255, 0.7)',
                zIndex: 1,
              }}
            >
              <CircularProgress />
            </Box>
          )}
          <DataGrid
            rows={filteredModels}
            columns={columns}
            pageSize={10}
            rowsPerPageOptions={[10]}
            checkboxSelection
            disableSelectionOnClick
            loading={loading}
            onSelectionModelChange={(newSelection) => {
              setSelectedRows(newSelection);
            }}
            onCellEditCommit={handleRowEditCommit}
          />
        </div>
      </Box>

      <Dialog open={open} onClose={() => !loading && setOpen(false)}>
        <DialogTitle>Add New Model</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Name"
            fullWidth
            value={newModel.name}
            onChange={(e) => setNewModel({ ...newModel, name: e.target.value })}
            disabled={loading}
          />
          <TextField
            margin="dense"
            label="Gladia"
            fullWidth
            value={newModel.gladia}
            onChange={(e) => setNewModel({ ...newModel, gladia: e.target.value })}
            disabled={loading}
          />
          <TextField
            margin="dense"
            label="FastWhisper"
            fullWidth
            value={newModel.fastwhisper}
            onChange={(e) => setNewModel({ ...newModel, fastwhisper: e.target.value })}
            disabled={loading}
          />
          <TextField
            margin="dense"
            label="Yandex Speech Kit"
            fullWidth
            value={newModel.yandexSpeechKit}
            onChange={(e) => setNewModel({ ...newModel, yandexSpeechKit: e.target.value })}
            disabled={loading}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setOpen(false)} disabled={loading}>
            Cancel
          </Button>
          <Button onClick={handleCreateModel} disabled={loading}>
            Create
          </Button>
        </DialogActions>
      </Dialog>

      <Snackbar
        open={!!error}
        autoHideDuration={6000}
        onClose={() => setError(null)}
      >
        <Alert onClose={() => setError(null)} severity="error">
          {error}
        </Alert>
      </Snackbar>
    </Box>
  );
}

export default Dashboard;
